import Header from "../../components/Header/Header"
import Footer from "../../components/footer/Footer"
import "./photo.css"

const Photo = () => {
  const photo_qty = 9
  const photos = []
  for (let i = 1; i <= photo_qty; i++) {
    photos.push(`photo_${i}`)
  }
  return (
    <>
      <Header />
      <section className="main">
        <div className="photos">
          {photos.map((photo_num, number) => {
            return (
              <div className={`${photo_num} .photo`} key={number}>
                {photo_num}
              </div>
            )
          })}
        </div>
      </section>
      <Footer />
    </>
  )
}

export default Photo
